import bpy


def armature_items(self, context):
    # List all armatures in the scene
    items = [(obj.name, obj.name, "") for obj in bpy.data.objects if obj.type == 'ARMATURE']

    return items

def find_exportable_collection_by_armature_name(armature_name):
    """Find the first collection that has exporters, starting from the collections containing the armature with the given name."""
    # Get the armature object by name
    armature = bpy.data.objects.get(armature_name)
    if armature is None:
        print(f"Armature '{armature_name}' not found.")
        return None, []
    
    # Ensure the object is of type 'ARMATURE'
    if armature.type != 'ARMATURE':
        print(f"Object '{armature_name}' is not an armature.")
        return None, []

    # Iterate over the collections the armature is part of
    for collection in armature.users_collection:
        # Traverse up the hierarchy until we find a collection with an exporter
        current_collection = collection
        while current_collection:
            if hasattr(current_collection, 'exporters') and current_collection.exporters:
                return current_collection
    return None, []

def collection_items(self, context):
    """Return all collections in the scene formatted for EnumProperty."""
    items = []

    # Iterate over all collections in the scene
    for collection in bpy.data.collections:
        # Format the collection for EnumProperty (identifier, name, description)
        items.append((collection.name, collection.name, f"Collection: {collection.name}"))

    return items

def get_performance_stats(armature_name, rating_mode):

    tri_count = 0
    material_set = set()
    bone_count = 0
    skinned_meshes = 0

    if rating_mode == 'ARMATURE' and armature_name:
        armature = bpy.data.objects.get(armature_name)
        
        if armature.type != 'ARMATURE':
            #print(f"No armature found with name '{armature_name}'")
            return None

        # Check if the armature is in Edit Mode
        if armature.mode == 'EDIT':
            bone_count = len(armature.data.edit_bones)
        else:
            bone_count = len(armature.data.bones)

        # Collect all objects parented to the armature
        objects = [obj for obj in bpy.context.scene.objects if obj.parent == armature]
    elif rating_mode == 'SCENE':
        # All visible objects in the scene
        objects = [obj for obj in bpy.context.visible_objects]

        # Get all armatures in the scene
        armatures = [obj for obj in bpy.context.visible_objects if obj.type == 'ARMATURE']

        # Sum up the bone counts of all armatures
        for armature in armatures:
            # Check if the armature is in Edit Mode
            if armature.mode == 'EDIT':
                bone_count += len(armature.data.edit_bones)
            else:
                bone_count += len(armature.data.bones)
    else:
        #print(f"Invalid rating_mode: '{rating_mode}'")
        return None

    # Get the evaluated dependency graph for accurate data
    depsgraph = bpy.context.evaluated_depsgraph_get()

    for obj in objects:
        if obj.type == 'MESH':
            # Get the evaluated mesh to account for modifiers
            eval_obj = obj.evaluated_get(depsgraph)
            mesh = eval_obj.to_mesh()

            # Ensure loop triangles are calculated
            mesh.calc_loop_triangles()
            tri_count += len(mesh.loop_triangles)

            # Collect materials
            for mat in mesh.materials:
                if mat:
                    material_set.add(mat.name)

            # Check if object has an armature modifier
            has_armature_modifier = any(mod.type == 'ARMATURE' for mod in obj.modifiers)
            if has_armature_modifier:
                skinned_meshes += 1

            # Clean up the mesh to free memory
            eval_obj.to_mesh_clear()

    return {
        "tri_count": tri_count,
        "material_count": len(material_set),
        "bone_count": bone_count,
        "skinned_meshes": skinned_meshes
    }

# Function to get rating based on stats
def get_rating(stats, device_mode):
    device = device_mode
    thresholds = RATING_THRESHOLDS[device]

    if all(stats[key] <= thresholds["Good"][key] for key in stats):
        return "Good"
    elif all(stats[key] <= thresholds["Medium"][key] for key in stats):
        return "Medium"
    else:
        return "Poor"
    
# Function to get icon based on value and limits
def get_icon(value, limits):
    if value == 0:
        return 'STRIP_COLOR_09'
    elif value <= limits[0]:
        return 'STRIP_COLOR_04'
    elif value <= limits[1]:
        return 'STRIP_COLOR_02'
    else:
        return 'STRIP_COLOR_01'



# Function to update the brush setting to weightpaint through mesh
def update_brush_settings(context):
    """Update brush settings based on the toggle state."""
    # Filter brushes that are relevant for weight painting
    weight_paint_brushes = [brush for brush in bpy.data.brushes if brush.use_paint_weight]
    
    for brush in weight_paint_brushes:
        if context.scene.paint_through_mesh:
            # When the toggle is enabled
            brush.use_frontface = False
            brush.use_frontface_falloff = False
            brush.falloff_shape = 'PROJECTED'
        else:
            # When the toggle is disabled
            brush.use_frontface = True
            brush.use_frontface_falloff = True
            brush.falloff_shape = 'SPHERE'



